  \"theodore-roosevelt-national-wildlife-refuge-complex-forest-habitat-management-plan-2010\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Wildlife Refuge System Improvement
  Act of 1997 established a clear legislative mission of wildlife conservation for
  national wildlife refuges. Theodore Roosevelt NWR Complex (TR Complex) consists
  of seven refuges within the National Wildlife Refuge System managed by the United
  States Fish and Wildlife Service. In 1997, activities were initiated to complete
  Comprehensive Conservation Plans (CCPs) on all refuges. The CCP for TR Complex was
  completed and approved in 2006. The Forest Habitat Management Plan (FHMP) for TR
  Complex focuses on the management of forested habitat for the benefit of wildlife
  species. TR Complex consists of approximately 42,000 acres of forested habitat with
  an additional 20,000 + acres of reforested agricultural lands.\",\n\t\"license_title\":
